buffer = ''

for i, b in enumerate(buffer):
    if i < 4:
        continue
    j = len(set(buffer[i - 4:i]))
    if j == 4:
        print(j + i - 4)
        break

for i, b in enumerate(buffer):
    if i < 14:
        continue
    j = len(set(buffer[i - 14:i]))
    if j == 14:
        print(j + i - 14)
        break
